import React from "react";
import SearchIcon from "@mui/icons-material/Search";
function ItemCreation() {
  return (
    <div className="p-10">
      <div className="flex justify-between items-center space-x-2">
        <div className="flex space-x-2 ite">

        <TextField size="small" fullWidth label="Search by ItemName/ItemCode" />
        <button type="button" className="bg-indigo-900 text-white rounded p-2">
          <SearchIcon />
        </button>
        </div>
        <button className="bg-indigo-900 text-white p-2 rounded whitespace-nowrap">+ Add</button>
      </div>
    </div>
  );
}

export default ItemCreation;
